/* Modified by grsmhiker from davielde's WME MapRaid Overlay script using data from the state of Tennessee http://tnmap.tn.gov/TNMapResources.asp*/
/* Updated on 2/27/2018 by MapOMatic, to address upcoming changes to WME code.

/*===About this script===
This will add a "TN Municipalities (some)" layer to the layers menu which, when enabled, will overlay Tennessee incorporated municipalities on the map.

The goal is NOT to get the cities layer to match up perfectly with the overlay! Rather, the goal is to ensure that city names are appropriately
applied to map features. In real life, cities tend to follow property lines. In Waze, the city names on map features determine city extent.

Only incorporated municipalities are listed. Census designated places are not included here and, in Tennessee, should be removed from map features.

Tennessee cities tend to annex property in long arms adjacent to major roads. Use care when deciding how to map features that extend far outside
of city limits in these areas, since city smudges can result. It may be wise to split road segments where they cross the city limits.

Data were provided to the state from individual municipalities and are highly likely to contain errors and inaccuracies.

Style and opacity can be adjusted on lines 50-61. and color can be changed on line 123. All cities are initially the same color, but colors
can be adjusted individually by editing the second line of each entry. #D698AD is a light pink color.
In this script:
*/

setTimeout(InitMapRaidOverlay, 1000);

function AddRaidPolygon(raidLayer,groupPoints,groupColor,groupNumber){

    var mro_Map = W.map;
    var mro_OL = OL;
    var raidGroupLabel = groupNumber;
    var groupName = groupNumber;

    var style = {
        strokeColor: "Orange",
        strokeOpacity: 0.30,
        strokeWidth: 3,
        fillColor: "Orange",
        fillOpacity: 0.10,
        label: raidGroupLabel,
        labelOutlineColor: "Black",
        labelOutlineWidth: 3,
        fontSize: 14,
        fontColor: "Pink",
        fontOpacity: 0.85,
        fontWeight: "bold"
    };

    var attributes = {
        name: groupName,
        number: groupNumber,
		holes: "false"
	};

    var pnt= [];
    for(i=0;i<groupPoints.length;i++){
        convPoint = new OL.Geometry.Point(groupPoints[i].lon,groupPoints[i].lat).transform(new OL.Projection("EPSG:4326"), mro_Map.getProjectionObject());
        //console.log('MapRaid: ' + JSON.stringify(groupPoints[i]) + ', ' + groupPoints[i].lon + ', ' + groupPoints[i].lat);
        pnt.push(convPoint);
    }

    var ring = new mro_OL.Geometry.LinearRing(pnt);
    var polygon = new mro_OL.Geometry.Polygon([ring]);

    var feature = new mro_OL.Feature.Vector(polygon,attributes,style);
    raidLayer.addFeatures([feature]);

}

function generateholes(mro_Map, raid_mapLayer, UntitledPolygon){
	var mro_mapLayers = mro_Map.getLayersBy("uniqueName","__Tennessee");
	var raid_mapLayerLength = raid_mapLayer.features.length;

	var style = raid_mapLayer.features[raid_mapLayerLength-2].style;
	var attributes = raid_mapLayer.features[raid_mapLayerLength-2].attributes;

	//console.dir(style);
	//console.dir(attributes);

	var newFeature = Subtract(raid_mapLayer.features[raid_mapLayerLength-2], raid_mapLayer.features[1]);

	//console.dir(raid_mapLayer);

	raid_mapLayer.addFeatures([newFeature]);

    raid_mapLayer.features[raid_mapLayerLength-1].destroy();
	raid_mapLayer.features[raid_mapLayerLength-2].destroy();

	//console.dir(mro_mapLayers);
	var mro_mapLayersFeaturesLength = mro_mapLayers[0].features.length;
    mro_mapLayers[0].features[mro_mapLayersFeaturesLength-1].style =  style;
	mro_mapLayers[0].features[mro_mapLayersFeaturesLength-1].attributes = attributes;
    mro_mapLayers[0].features[mro_mapLayersFeaturesLength-1].attributes.holes = "true";
	//raid_mapLayer.features[1].style = {label: "Updated label"};
    mro_mapLayers[0].redraw();

	//console.dir(raid_mapLayer);
}

function Subtract(bigFeature, smallFeature) {

    var newPolygon = new OL.Geometry.Polygon(bigFeature.geometry.components);
    var newFeature = new OL.Feature.Vector(newPolygon);

    newPolygon.addComponent(smallFeature.geometry.components[0]);

    return newFeature;
}

function CurrentRaidLocation(raid_mapLayer){
    var mro_Map = W.map;

    for(i=0;i<raid_mapLayer.features.length;i++){
        var raidMapCenter = mro_Map.getCenter();
        var raidCenterPoint = new OL.Geometry.Point(raidMapCenter.lon,raidMapCenter.lat);
        var raidCenterCheck = raid_mapLayer.features[i].geometry.components[0].containsPoint(raidCenterPoint);
		var holes = raid_mapLayer.features[i].attributes.holes;
		
        
        if(raidCenterCheck === true){

			var str = $('#topbar-container > div > div.location-info-region > div').text();
			
			var n2 = str.indexOf(" - ");
			
			if(n2 > 0){
				var n = str.length;
				var res = str.substring(n2+2, n);
				var rescount = res.indexOf(" - ");
				if(rescount>0){
					var n3 = res.length;
					var res2 = res.substring(rescount+2, n3);
				}
				var raidLocationLabel = 'County - ' + raid_mapLayer.features[i].attributes.number + ' - ' + res2;

			} else {
				var raidLocationLabel = 'County - ' + raid_mapLayer.features[i].attributes.number + ' - ' + $('#topbar-container > div > div.location-info-region > div').text();
						
			}	
			setTimeout(function(){$('#topbar-container > div > div.location-info-region > div').text(raidLocationLabel);},200);
			 if (holes === "false") { break; }
		}
    }
}



